import Element from './Element'
import ElementCont from './ElementCont'
import {Container } from '@material-ui/core'

function App() {
    return (
        <Container>
            <ElementCont title="Bubble Sort">
                <Element height={30}></Element>
                <Element height={50}></Element>
                <Element height={100}></Element>
                <Element height={60}></Element>
                <Element height={20}></Element>
                <Element height={0}></Element>
                <Element height={10}></Element>
                <Element height={150}></Element>
            </ElementCont>
        </Container>
    )
}

function genArray(n) {
    let ret = [];
    for(i = 0; i < n; i++) {
        ret[i] = i*(150/30);
    }
    return(shuffle(ret));
}

function shuffle(array) {
    var currentIndex = array.length,  randomIndex;

    // While there remain elements to shuffle...
    while (0 !== currentIndex) {

      // Pick a remaining element...
      randomIndex = Math.floor(Math.random() * currentIndex);
      currentIndex--;

      // And swap it with the current element.
      [array[currentIndex], array[randomIndex]] = [
        array[randomIndex], array[currentIndex]];
    }

    return array;
  }

export default App;
